import React from 'react';
import Iframe from 'react-iframe';

const Feeds = () => {
  return (
    <Iframe url="http://www.youtube.com/embed/xDMP3i36naA"
            width="950px"
            height="480px"
            id="myId"
            className="myClassname"
            display="initial"
            position="relative"/>
  );
}

export default Feeds;
